import React from 'react'

const Todo = ({list,addTodo}) => {

  return (


    <React.Fragment>
        {
            list.map((val,idx)=>{
               return <p key={idx}>{val} {idx}</p>
            })
        }

        <button onClick={()=>addTodo()}>add todo</button>
    </React.Fragment>
    )
}

export default Todo
